    "# anomaly 컬럼을 업데이트하여 inHd가 60 이하인 경우는 정상(1)으로 표시\n",
    "# 이상치의 판정은 우리가 원하는 부분만 따로 설정할수 없으므로 습도가 낮은 부분(60이하)은 이상치에서 제거\n",
